from tensorflow.keras.optimizers import SGD, Adam, RMSprop, Adagrad

import tensorflow as tf
from tensorflow import keras
import numpy as np
import matplotlib.pyplot as plt
from tensorflow.keras.optimizers import SGD, Adam, RMSprop, Adagrad

# Load the CIFAR-10 dataset
(x_train, y_train), (x_test, y_test) = keras.datasets.cifar10.load_data()

# Normalize the dataset to the range [0,1]
x_train, x_test = x_train / 255.0, x_test / 255.0

# Reshape the images for ANN (Flatten from 32x32x3 to 3072)
x_train = x_train.reshape(-1, 32 * 32 * 3)
x_test = x_test.reshape(-1, 32 * 32 * 3)

# Print dataset shape
print(f"Training Data Shape: {x_train.shape}, Labels Shape: {y_train.shape}")
print(f"Test Data Shape: {x_test.shape}, Labels Shape: {y_test.shape}")

# Display some images
class_names = ['airplane', 'automobile', 'bird', 'cat', 'deer',
               'dog', 'frog', 'horse', 'ship', 'truck']

plt.figure(figsize=(10, 5))
for i in range(10):
    plt.subplot(2, 5, i + 1)
    plt.imshow(x_train[i].reshape(32, 32, 3))  # Reshape back for visualization
    plt.title(class_names[y_train[i][0]])
    plt.axis('off')
plt.show()

"""#Step 2: Build a Complex ANN Model"""

def create_complex_model():
    model = keras.Sequential([
        keras.layers.Dense(2048, activation='relu', input_shape=(3072,)),
        keras.layers.BatchNormalization(),
        keras.layers.Dropout(0.3),

        keras.layers.Dense(1024, activation='relu'),
        keras.layers.BatchNormalization(),
        keras.layers.Dropout(0.3),

        keras.layers.Dense(512, activation='relu'),
        keras.layers.BatchNormalization(),
        keras.layers.Dropout(0.3),

        keras.layers.Dense(256, activation='relu'),
        keras.layers.BatchNormalization(),
        keras.layers.Dropout(0.3),

        keras.layers.Dense(10, activation='softmax')  # Output layer (10 classes)
    ])
    return model

"""#Step 3: Train and Evaluate the Model with Different Optimizers

![image.png](data:image/png;base64,)
"""

optimizers = {
    "SGD": SGD(learning_rate=0.01),
    "Momentum_SGD": SGD(learning_rate=0.01, momentum=0.9),
    "Adagrad": Adagrad(learning_rate=0.01),
    "RMSprop": RMSprop(learning_rate=0.01),
    "Adam": Adam(learning_rate=0.01)
}

results = {}

for name, opt in optimizers.items():
    print(f"Training with {name} optimizer...")
    model = create_complex_model()
    model.compile(optimizer=opt, loss='sparse_categorical_crossentropy', metrics=['accuracy'])
    history = model.fit(x_train, y_train, epochs=15, batch_size=64, validation_data=(x_test, y_test), verbose=1)
    results[name] = history.history

"""#Step 4: Compare the Performance of Optimizers"""

plt.figure(figsize=(10,6))
for name, history in results.items():
    plt.plot(history['val_accuracy'], label=name)
plt.title("Validation Accuracy for Different Optimizers")
plt.xlabel("Epochs")
plt.ylabel("Accuracy")
plt.legend()
plt.show()

"""#Step 5: Analyze the Impact of Learning Rate, Batch Size, Dropout, and Batch Normalization

#5.1 Impact of Learning Rate

#learning_rates = [0.001, 0.01, 0.1]
"""

# Store optimizer classes, NOT instances
optimizers = {
    "SGD": tf.keras.optimizers.SGD,
    "Momentum_SGD": tf.keras.optimizers.SGD,
    "Adagrad": tf.keras.optimizers.Adagrad,
    "RMSprop": tf.keras.optimizers.RMSprop,
    "Adam": tf.keras.optimizers.Adam
}

import itertools

learning_rates = [0.001, 0.01, 0.1]
results_lr = {}

for name, opt in optimizers.items():  # Loop over optimizers
    for lr in learning_rates:  # Loop over learning rates
        print(f"Training with {name} optimizer and learning rate {lr}...")

        model = create_complex_model()
        optimizer = opt(learning_rate=lr, momentum=0.9) if name == "Momentum_SGD" else opt(learning_rate=lr)

        model.compile(optimizer=optimizer, loss='sparse_categorical_crossentropy', metrics=['accuracy'])
        history = model.fit(x_train, y_train, epochs=15, batch_size=64, validation_data=(x_test, y_test), verbose=1)

        # Store history correctly with optimizer name
        results_lr[f"{name}_lr_{lr}"] = history.history

import matplotlib.pyplot as plt
import seaborn as sns
import pandas as pd

plt.figure(figsize=(12,6))

# Convert results dictionary to a DataFrame for Seaborn
plot_data = []

for key, history in results_lr.items():
    for epoch, acc in enumerate(history['val_accuracy']):
        plot_data.append([key, epoch, acc])

# Create DataFrame outside the loop
df = pd.DataFrame(plot_data, columns=['Optimizer_LR', 'Epoch', 'Val_Accuracy'])

# Plot using Seaborn with a rainbow palette
sns.lineplot(data=df, x='Epoch', y='Val_Accuracy', hue='Optimizer_LR', palette='rainbow')

plt.title("Validation Accuracy for Different Optimizers and Learning Rates")
plt.xlabel("Epochs")
plt.ylabel("Accuracy")
plt.legend(title="Optimizer & LR", bbox_to_anchor=(1.05, 1), loc='upper left')  # Move legend outside
plt.show()

"""![image.png](data:image/png;base64,)

#5.2 Impact of Batch Size

#batch_sizes = [32, 64, 128]
"""

batch_sizes = [32, 64, 128]
results_bs = {}

for name,opt in optimizers.items():
  for bs in batch_sizes:
    print(f"Training with Adam optimizer and batch size {bs}...")
    model = create_complex_model()
    optimizer = opt(learning_rate=0.01,momentum=0.9) if name=='Momentum_SGD' else opt(learning_rate=0.01)
    model.compile(optimizer=optimizer, loss='sparse_categorical_crossentropy', metrics=['accuracy'])
    history = model.fit(x_train, y_train, epochs=15, batch_size=bs, validation_data=(x_test, y_test), verbose=1)
    results_bs[f"{name}Adam_bs_{bs}"] = history.history

"""#BatchSize Effect of Different Optimizers Visualization"""

plt.figure(figsize=(12,6))


plot_data=[]
for key, history in results_bs.items():
  for epoch,acc in enumerate(history['val_accuracy']):
    plot_data.append([key,epoch,acc])

#converting the data to dataframe
df = pd.DataFrame(plot_data,columns=['Name_Opt','Epoch','ValAccuracy'])

#now plotting the dataframe using seaborn
